window.bookSummaryJSON = "<p>Life as a teenager is never easy. But for Natalee Murray, things have just gotten way more difficult. Bored with life, she can't wait to graduate high school and get out of town, especially considering the famous band members from AD2 suddenly start attending her school, making her once-boring life absolutely insane. </p> <p>It starts with a pen. A single brush of fingers and she is captivated. But Alec and Demetri have a dark secret, one that could shatter their reputations and Natalee's heart. What do you do when one guy paints your life with color while the other infuses your soul with passion? How do you choose when your heart is divided? </p> <p>This is a New Adult/Mature YA. Minor swearing and drug usage. </p> <p>Cover by P. S. Cover Designs </p>"; 
